        (function (l) {
            if (l.search) {
                var q = {};

                l.search.slice(1).split('&').forEach(function (v) {
                    var a = v.split('=');
                    q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
                });

                if (q.p !== undefined) {
                    window.history.replaceState(null, null,
                        l.pathname.slice(0, -1) + (q.p || '') +
                        (q.q ? ('?' + q.q) : '') +
                        l.hash
                    );
                }
            }
        }(window.location))</script></head><body><noscript style="font-family: sans-serif; font-weight: bold;">자바스크립트를 활성화 시켜주세요!<br>You need to enable JavaScript to see the page!</noscript><script src="dist/vendors~main.e968d301c6f75149420c.js"></script><script src="dist/main.a0011b29b40d4dbaf9a5.js"></script></body></html>
